@font-face {
    font-family: 'Gordita';
    font-style: normal;
    font-weight: normal;
    src: url("data:font/woff;base64,") format('woff');
}

* {
font-family: 'Gordita'!important;
}

h1 {
    font-size: 20px!important;
    color: #232323!important;
}
